function readheader(header) {
  let layers = header.split(/[ -]/);
  // console.log(layers);
  let result = [1, 1, 1];
  let out = Number(layers[3]);
  result[2] = out;
  let hid = Number(layers[2]);
  result[1] = hid;
  // result[0] = new Array(hid);
  let elements = layers[1].split('+');
  // console.log(elements);
  let input = elements.map(Number);
  result[0] = input;
  // console.log(result);
  return result;
}

function parse(txt, layers) {
  let result = '';
  weights = txt.split(',').map(Number);
  // console.log(weights.length);
  // console.log((64 + 2 + 1 + 1) * 8 + 8 + 1);
  let i = 0;
  // cells
  for (let l = 0 ; l < layers[1] ; ++l) {
    for (let y = 0 ; y < 8 ; ++y) {
      let line = '|';
      for (let x = 0 ; x < 8 ; ++x) {
        line += weights[x * 8 + y + i].toFixed(1) + '|';
      }
      result += line + '<br>';
    }
    result += '<br>';
    i += layers[0][0];
  }
  result += '|';
  // turn
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += weights[l + i].toFixed(1) + '|';
    i += layers[0][1];
  }
  result += '<br><br>';
  // fixed stone
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|' + weights[i].toFixed(1) + '|';
    result += weights[i + 1].toFixed(1) + '|<br>';
    i += layers[0][2];
  }
  result += '<br>';
  // bias
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|' + weights[i].toFixed(1);
    ++i;
  }
  result += '|<br><br>';
  // hidden
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|' + weights[i].toFixed(1);
    ++i;
  }
  // bias
  result += '|<br><br>|' + weights[i].toFixed(1) + '|<br>';
  return result;
}

const levelp = ["・", "ｏ", "○", "Ｏ", "◯", "◎", "🟡", "🟠", "🔴"];
const zero = "　"
const levelm = ["一", "二", "三", "井", "％", "※", "🟢", "🔵", "🟣"];

function num2markLog(n) {
  let nn = Math.abs(n)
  if (nn < 1) return zero;

  let i = Math.round(Math.log(nn));
  if (i >= levelp.length - 1) i = levelp.length - 1;
  if (n > 0) return levelp[i];
  return levelm[i];
}

function num2markLog2(n) {
  let nn = Math.abs(n)
  if (nn < 1) return "<font color='white'>■</font>";

  let i = Math.round(Math.log10(nn) * 64);
  if (i > 255) {i = 255;}
  i = 255 - i;
  let val = i.toString(16);
  if (val.length == 1) {val = "0" + val;}
  val += val;
  if (n > 0) return "<font color='#ff" + val + "'>■</font>";
  return "<font color='#" + val + "ff'>■</font>";
}

function bluewhitered(nn, i) {
  if (nn < 1) return 'ffff';
 
  i = 255 - i;
  let val = i.toString(16);
  if (val.length == 1) {val = "0" + val;}
  val += val;
  return val;
}

function cool2warm(i) {
  if (i < 0) return tblcool2warm[0];
  if (i > 255) return tblcool2warm[255];
  return tblcool2warm[i];
}

/* yellow - purple */
function viridis(i) {
  if (i < 0) return tblviridis[0];
  if (i > 255) return tblviridis[255];
  return tblviridis[i];
}

function num2markLn(n) {
  let nn = Math.abs(n * 2.71828182846);
  if (nn < 1) return "<font color='white'>■</font>";
  /* blue - white - red *
  let i = Math.round(Math.log(nn) * 64);
  if (i > 255) {i = 255;}
  let val = bluewhitered(nn, i);
  if (n > 0) return "<font color='#ff" + val + "'>■</font>";

  return "<font color='#" + val + "ff'>■</font>";*/

  /* viridis */
  let i = Math.round(Math.log(nn) * 32);
  if (n < 0) i = -i;
  i += 128;
  let val = cool2warm(i);//viridis(i);
  return "<span style='color:rgb(" + val + ")'>■</span>";
}

function num2marklinear(n) {
  let nn = Math.abs(n)
  if (nn < 1) return zero;

  let i = Math.round(nn / 20.0);
  if (i >= levelp.length - 1) i = levelp.length - 1;
  if (n > 0) return levelp[i];
  return levelm[i];
}

function num2txt(n) {
  return n.toFixed(2);
}

function parseascii(txt, layers, converter) {
  let result = '';
  weights = txt.split(',').map(Number);
  let i = 0;

  for (let l = 0 ; l < layers[1] ; ++l) {
    result += "|   |   |   |   |   |   |   |   |\n|---|---|---|---|---|---|---|---|\n";
    for (let y = 0 ; y < 8 ; ++y) {
      let line = ''
      for (let x = 0 ; x < 8 ; ++x) {
        line += '|' + converter(weights[x * 8 + y + i]);
      }
      result += line + '|\n';
    }
    result += '\n\n\n';
    i += layers[0][0];
  }
  let tmp = '|\n';
  let ali = '|\n';
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|   ';
    ali += '|---';
    tmp += '|' + converter(weights[l + i]);
    i += layers[0][1];
  }
  result += ali + tmp + '|\n\n\n';
  result += '|   |   |\n|---|---|\n';
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|' + converter(weights[i]) + '|'
        + converter(weights[i + 1]) + '|\n';
    i += layers[0][2];
  }
  result += '\n\n';
  tmp = '|\n';
  ali = '|\n';
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|   ';
    ali += '|---';
    tmp += '|' + converter(weights[i]);
    i += 1;
  }
  result += ali + tmp + '|\n\n';
  tmp = '|\n';
  ali = '|\n';
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|   ';
    ali += '|---';
    tmp += '|' + converter(weights[i]);
    i += 1;
  }
  result += ali + tmp + '|\n\n';
  result += converter(weights[i]) + '<br>';
  return result;
}

function parseasciitbl(txt, layers, converter) {
  let result = '';
  weights = txt.split(',').map(Number);
  let i = 0;

  result += '<div class="grp">';
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += "<table border=1 cellspacing=0><caption>cell:" + l + "</caption>";
    for (let y = 0 ; y < 8 ; ++y) {
      let line = '<tr>'
      for (let x = 0 ; x < 8 ; ++x) {
        line += '<td>' + converter(weights[x * 8 + y + i]) + '</td>';
      }
      result += line + '</tr>';
    }
    result += '</table>\n';
    i += layers[0][0];
  }
  result += '</div>';
  result += '<table border=1 cellspacing=0><caption>turn</caption>';
  let sz = layers[1]
  for (let l = sz ; l > 0 ; ) {
    const COLUMNS = 256;
    let sz2 = l >= COLUMNS ? COLUMNS : l;
    l -= COLUMNS;
    result += '<tr>';
    for (let m = 0 ; m < sz2 ; ++m) {
      result += '<td>' + converter(weights[l + i]) + '</td>';
      ++i;
    }
    result += '</tr>';
  }
  result += '</table>\n';
  result += '<table border=1 cellspacing=0><caption>fixed stones</caption><tr>';
  let tmp = '</tr><tr>'
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '<td>' + converter(weights[i]) + '</td>';
    tmp += '<td>' + converter(weights[i + 1]) + '</td>';
    i += layers[0][2];
  }
  result += tmp + '</tr></table>\n';
  result += '<table border=1 cellspacing=0><caption>bias</caption>';
  for (let l = sz ; l > 0 ; ) {
    const COLUMNS = 256;
    let sz2 = l >= COLUMNS ? COLUMNS : l;
    l -= COLUMNS;
    result += '<tr>';
    for (let m = 0 ; m < sz2 ; ++m) {
      result += '<td>' + converter(weights[l + i]) + '</td>';
      ++i;
    }
    result += '</tr>';
  }
  result += '</table>\n';
  result += '<table border=1 cellspacing=0><caption>hidden</caption><tr>';
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '<td>' + converter(weights[i]) + '</td>';
    i += 1;
  }
  result += '</tr></table>\n';
  result += '<table border=1 cellspacing=0><caption>bias</caption><tr><td>'
      + converter(weights[i]) + '</td></tr></table>\n';
  return result;
}

function runnum() {
  let txt = document.getElementById('input').value.split('\n');
  // console.log(txt);
  let out = document.getElementById('output');
  let layers = readheader(txt[0]);
  out.innerHTML = parse(txt[1], layers);
}

function runasc(type) {
  let txt = document.getElementById('input').value.split('\n');
  // console.log(txt);
  let out = document.getElementById('output');
  let layers = readheader(txt[0]);
  // out.innerHTML = parseascii(txt[1], layers);
  if (type == "linear") {
    out.innerHTML = markdown.parse(parseascii(txt[1], layers, num2marklinear));
  } else if (type == "log10") {
    // out.innerHTML = markdown.parse(parseasciitbl(txt[1], layers, num2markLog2));
    out.innerHTML = parseasciitbl(txt[1], layers, num2markLog2);
  } else if (type == "logE") {
    // out.innerHTML = markdown.parse(parseasciitbl(txt[1], layers, num2markLn));
    out.innerHTML = parseasciitbl(txt[1], layers, num2markLn);
  }
}

function NNCalc5(txt, layers, cells) {
  let ret = "";
  for (let iset = 1; iset <= layers[0]; ++iset) {
    let title = "# part: " + iset;
    let n_hidden1 = layers[2];
    let hidden1sum = new Array(n_hidden1).fill(0.0);
    let hidden1 = new Array(n_hidden1).fill(0.0);
    let n_hidden2 = layers[3];
    let hidden2sum = new Array(n_hidden2).fill(0.0);
    let hidden2 = new Array(n_hidden2).fill(0.0);
    weights = txt[iset].split(',').map(Number);
    let output = weights.slice(-1) - 0;

    for (let c = 0; c < 64; ++c) {
      if (cells[c] == 0 && cells[c + 64] == 0) continue;

      if (cells[c] != 0) {  // sente
        for (let i = 0; i < n_hidden1; ++i) {
          let idx = c + i * 128;
          hidden1sum[c] += weights[idx];
        }
        continue;
      }

      // gote
      for (let i = 0; i < n_hidden1; ++i) {
        let idx = c + i * 128 + 64;
        hidden1sum[c] += weights[idx];
      }
    }

    for (let i = 0; i < n_hidden1; ++i) {
      // teban
      let offset_teban = 128 * n_hidden1 + i;
      hidden1sum[i] += weights[offset_teban] * cells[128];
      // fs b
      // fs w
      let offset_dc = (128 + 1 + 2)* n_hidden1 + i;
      hidden1sum[i] += weights[offset_dc] * cells[128];
      // relu
      hidden1[i] = Math.max(hidden1sum[i], 0.0);
    }

    for (let j = 0; j < n_hidden2; ++j) {
      for (let i = 0; i < n_hidden1; ++i) {
        let offset = (128 + 1 + 2 + 1)* n_hidden1 + i + j * n_hidden1;
        hidden2sum[j] += hidden1[i] * weights[offset];
      }
      let offset_dc = (128 + 1 + 2 + 1)* n_hidden1 + n_hidden2 * n_hidden1 + j;
      hidden2sum[j] += weights[offset_dc];

      hidden2[j] = Math.max(hidden2sum[j], 0.0);
    }
    for (let j = 0; j < n_hidden2; ++j) {
      let offset = (128 + 1 + 2 + 1)* n_hidden1
              + n_hidden2 * (n_hidden1 + 1) + j;
      output += hidden2[j] * weights[offset];
    }

    ret += NNVisualize5(
      title, cells, hidden1sum, hidden1, hidden2sum, hidden2, output);
  }
  return ret;
}

    let ali = '|\n';
    for (let l = 0; l < layers[1]; ++l) {
      result += '|   ';
      ali += '|---';
      tmp += '|' + converter(weights[l + i]);
    }
    i += layers[1];
    result += ali + tmp + '|\n\n';
  }
  result += 'hidden1-bias  \n\n';
  tmp = '|\n';
  ali = '|\n';
  for (let l = 0; l < layers[2]; ++l) {
    result += '|   ';
    ali += '|---';
    tmp += '|' + converter(weights[i]);
    ++i;
  }
  result += ali + tmp + '|\n\n';

  result += 'hidden2  \n\n';
  tmp = '|\n';
  ali = '|\n';
  for (let l = 0; l < layers[2]; ++l) {
    result += '|   ';
    ali += '|---';
    tmp += '|' + converter(weights[i]);
    ++i;
  }
  result += ali + tmp + '|\n\n';

  result += 'hidden2-bias  \n\n|   |\n|---|\n|';
  result += converter(weights[i]) + '|\n<br>';

  return result;
}

function parseasciitbl7(txt, layers, converter) {
  let result = '';
  weights = txt.split(',').map(Number);
  let i = 0;

  result += '<div class="grp">';
  for (let l = 0; l < layers[1]; ++l) {
    result += "<table border=1 cellspacing=0><caption>cell-b:" + l + "</caption>";
    for (let y = 0; y < 8; ++y) {
      let line = '<tr>'
      for (let x = 0; x < 8; ++x) {
        line += '<td>' + converter(weights[x + y * 8 + i]) + '</td>';
      }
      result += line + '</tr>';
    }
    result += '</table>\n';
    result += "<table border=1 cellspacing=0><caption>cell-w:" + l + "</caption>";
    for (let y = 0; y < 8; ++y) {
      let line = '<tr>'
      for (let x = 0; x < 8; ++x) {
        line += '<td>' + converter(weights[x + y * 8 + i + 64]) + '</td>';
      }
      result += line + '</tr>';
    }
    result += '</table>\n';
    i += layers[0][0];
  }
  result += '</div>';
  let sz = layers[1]
  const COLUMNS = 128;
  result += '<table border=1 cellspacing=0><caption>bias</caption>';
  for (let l = sz ; l > 0 ; ) {
    let sz2 = l >= COLUMNS ? COLUMNS : l;
    l -= COLUMNS;
    result += '<tr>';
    for (let m = 0 ; m < sz2 ; ++m) {
      result += '<td>' + converter(weights[i]) + '</td>';
      ++i;
    }
    result += '</tr>';
  }
  result += '</table>\n';
  result += '<div class="grp">';
  for (let k = 0; k < layers[2]; ++k) {
    result += "<table border=1 cellspacing=0><caption>hidden1-" + k + "</caption>";
    for (let l = 0; l < 4; ++l) {
      result += '<tr>';
      for (let m = 0; m < layers[1] / 4; ++m) {
        result += '<td>' + converter(weights[i]) + '</td>';
        ++i;
      }
      result += '</tr>';
    }
    result += '</table>\n';
  }
  result += '</div>';

  result += '<table border=1 cellspacing=0><caption>hidden1-bias</caption><tr>';
  for (let l = 0; l < layers[2]; ++l) {
    result += '<td>' + converter(weights[i]) + '</td>';
    ++i;
  }
  result += '</tr></table>\n';
  result += '<table border=1 cellspacing=0><caption>hidden2</caption><tr>';
  for (let l = 0; l < layers[2]; ++l) {
    result += '<td>' + converter(weights[i]) + '</td>';
    ++i;
  }
  result += '</tr></table>\n';
  result += '<table border=1 cellspacing=0><caption>hidden2-bias</caption><tr><td>'
      + converter(weights[i]) + '</td></tr></table>\n';
  return result;
}

function runasc7(type) {
  let txt = document.getElementById('input7').value.split('\n');
  // console.log(txt);
  let out = document.getElementById('output7');
  let layers = readheader7(txt[0]);
  let n2mk;
  if (type == "linear") {
    n2mk = num2marklinear;
  } else if (type == "log10") {
    n2mk = num2markLog2;
  } else if (type == "logE") {
    n2mk = num2markLn;
  }

  let inner_layers = [...layers];
  inner_layers.shift();

  let result = "";
  for (let iset = 1; iset <= layers[0]; ++iset) {
    result += "<h1>part:" + iset + "</h1>";
    if (type == "linear") {
      result += markdown.parse(parseascii7(txt[iset], inner_layers, n2mk));
    } else {
      result += parseasciitbl7(txt[iset], inner_layers, n2mk);
    }
  }
  out.innerHTML = result;
}

function NNCalc7(txt, layers, cells) {
  let ret = "";
  for (let iset = 1; iset <= layers[0]; ++iset) {
    let title = "# part: " + iset;
    let n_hidden1 = layers[2];
    let hidden1sum = new Array(n_hidden1).fill(0.0);
    let hidden1 = new Array(n_hidden1).fill(0.0);
    let n_hidden2 = layers[3];
    let hidden2sum = new Array(n_hidden2).fill(0.0);
    let hidden2 = new Array(n_hidden2).fill(0.0);
    weights = txt[iset].split(',').map(Number);
    let output = weights.slice(-1) - 0;

    for (let c = 0; c < 64; ++c) {
      if (cells[c] == 0 && cells[c + 64] == 0) continue;

      if (cells[c] != 0) {  // sente
        for (let i = 0; i < n_hidden1; ++i) {
          let idx = c + i * 128;
          hidden1sum[c] += weights[idx];
        }
        continue;
      }

      // gote
      for (let i = 0; i < n_hidden1; ++i) {
        let idx = c + i * 128 + 64;
        hidden1sum[c] += weights[idx];
      }
    }

    for (let i = 0; i < n_hidden1; ++i) {
      // relu
      hidden1[i] = Math.max(hidden1sum[i], 0.0);
    }

    for (let j = 0; j < n_hidden2; ++j) {
      for (let i = 0; i < n_hidden1; ++i) {
        let offset = (128 + 1)* n_hidden1 + i + j * n_hidden1;
        hidden2sum[j] += hidden1[i] * weights[offset];
      }
      let offset_dc = (128 + 1)* n_hidden1 + n_hidden2 * n_hidden1 + j;
      hidden2sum[j] += weights[offset_dc];

      hidden2[j] = Math.max(hidden2sum[j], 0.0);
    }
    for (let j = 0; j < n_hidden2; ++j) {
      let offset = (128 + 1)* n_hidden1
              + n_hidden2 * (n_hidden1 + 1) + j;
      output += hidden2[j] * weights[offset];
    }

    ret += NNVisualize7(
      title, cells, hidden1sum, hidden1, hidden2sum, hidden2, output);
  }
  return ret;
}

function array2csv(arr, n) {
  return arr.map(num => num.toFixed(n)).join(',');
}
function readrfen(rfen) {
  let res = [];
  let index = 0;
  let cells = new Array(129).fill(0);
  const tblsente = "/ABCDEFGH";
  const tblgote = "/abcdefgh";
  const tblblank = "/12345678";
  for (let ch of rfen.split('')) {
    if (ch == ' ') break;

    let idxb = tblblank.indexOf(ch);
    if (idxb >= 0) {
      index += idxb;
      continue;
    }

    let idxs = tblsente.indexOf(ch);
    if (idxs >= 0) {
      for (let i = 0; i < idxs; ++i) {
        cells[index + i] = 1.0;
      }
      index += idxs;
      continue;
    }

    let idxg = tblgote.indexOf(ch);
    if (idxg < 0) {
      continue;
    }

    for (let i = 0; i < idxg; ++i) {
      cells[index + i + 64] = 1.0;
    }
    index += idxg;
  }

  if (rfen.slice(-1) == "w") {
    cells[128] = -1;
  } else {
    cells[128] = 1;
  }

  return cells;
}

function pasteText(txtarea) {
  let ta = document.getElementById(txtarea);
  if(navigator.clipboard){
    navigator.clipboard.readText()
      .then(function(text){
        ta.textContent = text;
    });
    return;
  }

  ta.execCommand("paste");
}
